import { DefaultTheme } from "styled-components";

const theme: DefaultTheme = {
  basicWidth: "1440px",

  color: {
    lightBlue: "#1565C0",
    blue: "#1565C0",
    gray: "#323D45",
    lightgray: "#939FA5",
    yellow: "#FFA000"
  }
};



export { theme };
